[[package]]
name = "flask"
version = "3.0.2"
requires_python = ">=3.8"
summary = "A simple framework for building complex web applications."
dependencies = [
    "Jinja2>=3.1.2",
    "Werkzeug>=3.0.0",
    "blinker>=1.6.2",
    "click>=8.1.3",
    "itsdangerous>=2.1.2",
]

[[package]]
name = "flask-httpauth"
version = "4.8.0"
summary = "HTTP authentication for Flask routes"
dependencies = [
    "flask",
]

[[package]]
