[[package]]
name = "gunicorn"
version = "21.2.0"
requires_python = ">=3.5"
summary = "WSGI HTTP Server for UNIX"
dependencies = [
    "packaging",
]

[[package]]
name = "inflection"
version = "0.5.1"
requires_python = ">=3.5"
summary = "A port of Ruby on Rails inflector to Python"

[[package]]
name = "itsdangerous"
version = "2.1.2"
